INSERT INTO `dbc_pages` (`id`, `alias`, `show_in_menu`, `layout`, `content_from`, `title`, `url`, `content`, `sidebar`, `seo_settings`, `create_time`, `status`, `editable`, `parent`) VALUES ('13', 'cookie_policy', '0', '2', 'Manual', '[cookie_policy]', 'page/cookie_policy', '<div class=\"col-md-9\">\n<div class=\"page-sidebar\">\n<p style=\"margin: 0cm 0cm 12pt\"><strong>What are Cookies?</strong><br /> A cookie is a very small piece of information that a website stores to save and collect basic information.<br style=\"box-sizing: border-box\" /> Many cookies are essential to the operation of our website, for example to allow you to make a purchase or create an account with us.<br style=\"box-sizing: border-box\" /> Cookies on our site are also used to customise certain areas of content just for you, and to make your browsing experience more efficient and faster.<br style=\"box-sizing: border-box\" /> <br style=\"box-sizing: border-box\" /> <strong>How we use Cookies</strong><br style=\"box-sizing: border-box\" /> Cookies on our website are used for the following purposes</p>\n<ul style=\"list-style-type: disc\">\n<li style=\"margin-bottom: 3pt\">To enable you to login to the system</li>\n<li style=\"margin-bottom: 3pt box-sizing: border-box background-position: 0px 0.45em\">To enable you to system messages</li>\n<li style=\"margin-bottom: 3pt box-sizing: border-box background-position: 0px 0.45em\">To improve the website\'s usability by saving loading time</li>\n<li style=\"margin-bottom: 3pt box-sizing: border-box background-position: 0px 0.45em\">To analyse the use of our website through Analytics software such as Google Analytics.</li>\n</ul>\n<p></p>\n<p><strong>Information Collected</strong><br style=\"box-sizing: border-box\" /> The cookies our website doesn\'t collect any private data</p>\n</div>\n</div>', '', '{\"meta_description\":\"cookie policy\",\"key_words\":\"cookie,policy\",\"crawl_after\":\"3\"}', '1476443264', '1', '1', '0');


