\\\"Swimming pool\\\">&not;&dagger;Swimming pool<\\/div>\\r\\n<div class=\\\"\\r\\nimportant_facility  \\r\\n\\\" data-name-en=\\\"Pets allowed\\\">&not;&dagger;Pets allowed<\\/div>\\r\\n<div class=\\\"\\r\\nimportant_facility  \\r\\n\\\" data-name-en=\\\"Family Rooms\\\">&not;&dagger;Family rooms<\\/div>\\r\\n<div class=\\\"\\r\\nimportant_facility  \\r\\n\\\" data-name-en=\\\"Non Smoking Rooms\\\">&not;&dagger;Non-smoking rooms<\\/div>\\r\\n<div class=\\\"\\r\\nimportant_facility  \\r\\n\\\" data-name-en=\\\"Bar\\\">&not;&dagger;Bar<\\/div>\\r\\n<\\/div>\\r\\n<p class=\\\"hp-good-segment-facility-score\\\">Good for couples - they rate the facilities 9.1 for two-person stays.<\\/p>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p>&nbsp;<\\/p>\",\"es\":\"\",\"ru\":\"\",\"ar\":\"\",\"de\":\"\",\"fr\":\"\",\"it\":\"\",\"pt\":\"\",\"zh\":\"\",\"tr\":\"\",\"hi\":\"\",\"bn\":\"\"}', 'hotel, parking, pool', '0.0', '4', '4', '', '{\"en\":\" 725 WHARF STREET SW, Southwest, Washington, 20024, USA\",\"es\":\"\",\"ru\":\"\",\"ar\":\"\",\"de\":\"\",\"fr\":\"\",\"it\":\"\",\"pt\":\"\",\"zh\":\"\",\"tr\":\"\",\"hi\":\"\",\"bn\":\"\"}', '1234567', 'https://dc.justmy.com/dashboard', '2019', 'akioUnity@outlook.com', '1', '51', '93', '', '38.90720000', '77.03690000', '4df7aef2_w.jpg', NULL, NULL, NULL, NULL, NULL, '2', '1567332947', '1567332947', '1567334822', '1', '2019-09-01', '2019-10-31', '1', '2019-10-31', '0', '3', 'Hotels & Resorts Hotels & Resorts 2019 USA Washington Seattle  Hyatt House Washington   725 WHARF STREET SW, Southwest, Washington, 20024, USA                       hotel, parking, pool ');


